import React, { Component } from 'react'
import EdyodaLogo from './EdyodaLogo'
class TopBar extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }
  render() {
    return (
      <>
        <EdyodaLogo />
      </>
    )
  }
}
export default TopBar
